import React, {useState, useEffect} from 'react';

const axios = require('axios');

export const History = () => {
    const [data,setData]=useState([]);
    const url = 'http://localhost:3001/fires?Counties=';
    const arr = ["Sonoma", "Butte", "Napa"];
    const county = 0;
    const queries = arr.map(county => url+county);
    console.log(queries);

    const getData = () => {
        axios.all(
            axios.get(queries[0]),
            axios.get(queries[1]),
            axios.get(queries[2]),
        )
        .then(res => setData(res.data));
    };

    useEffect(()=>{
        getData();
    },[])

    console.log(data);

    return(<p>hi</p>);
};
